
create extension if not exists "uuid-ossp";

drop table if exists vendor_xny, product_mcn, vendor_product_info_1je, car_lhv, vendor_car_info_hzu cascade;

create table vendor_xny
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_mcn
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table vendor_product_info_1je
(
    vendor_id uuid references vendor_xny,
    product_id uuid references product_mcn,
    price numeric,
    quantity int,
    primary key (product_id, vendor_id)
);

create table car_lhv
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table vendor_car_info_hzu
(
    vendor_id uuid references vendor_xny,
    car_id uuid references car_lhv,
    quantity int,
    primary key (car_id, vendor_id)
);






--1 
select distinct model from product_mcn
join vendor_product_info_1je on product_mcn.id = vendor_product_info_1je.product_id
join vendor_xny on vendor_product_info_1je.vendor_id = vendor_xny.id
where  category = 'смартфоны' and brand not in ('Xiaomi', 'HONOR', 'HUAWEI')and price between 15000 and 25000;


--2
select name from vendor_xny
join vendor_product_info_1je on vendor_xny.id = vendor_product_info_1je.vendor_id
join  product_mcn on vendor_product_info_1je.product_id = product_mcn.id
where category = 'смартфоны' and os in ('Android', 'iOS');


--3
select name from vendor_xny
join vendor_product_info_1je on vendor_xny.id = vendor_product_info_1je.vendor_id
join  product_mcn on vendor_product_info_1je.product_id = product_mcn.id
where category = 'часы'
except 
select name from vendor_xny
join vendor_product_info_1je on vendor_xny.id = vendor_product_info_1je.vendor_id
join  product_mcn on vendor_product_info_1je.product_id = product_mcn.id
where category = 'смартфон';


--4
select distinct name from vendor_xny
join vendor_product_info_1je on vendor_xny.id = vendor_product_info_1je.vendor_id
join  product_mcn on vendor_product_info_1je.product_id = product_mcn.id
where category = 'ноутбуки'
except 
select distinct name from vendor_xny
join vendor_product_info_1je on vendor_xny.id = vendor_product_info_1je.vendor_id
join  product_mcn on vendor_product_info_1je.product_id = product_mcn.id
where category = 'мониторы'
union
select name from vendor_xny
join vendor_car_info_hzu on vendor_car_info_hzu.vendor_id = vendor_xny.id
join car_lhv on vendor_car_info_hzu.car_id = car_lhv.id
where body_volume >= 30 and lifting_capacity >= 20;


--5
select min(price), max(price), avg(screen_size), sum(price * quantity) from product_mcn
join vendor_product_info_1je on product_mcn.id = vendor_product_info_1je.product_id
where category = 'электронные книги' and brand = 'Amazon';

--6
select distinct model from product_mcn
where weight = (select min(weight) from product_mcn where category = 'электронные книги')
union 
select distinct model from 
(select distinct id, model from product_mcn where weight = (select min(weight) from product_mcn where category = 'электронные книги')) product_mcn
join vendor_product_info_1je on vendor_product_info_1je.product_id = product_mcn.id
where price = (select min(price) from product_mcn
join vendor_product_info_1je on vendor_product_info_1je.product_id = product_mcn.id);

